    <h2 class="header">Page Source</h2>
    <pre><textarea class="page-source" readonly>content: &#34;**説明:** 第███小学校3年6組に在籍している生徒40名。2015年夏季休暇中の自由研究において全員が「乳幼児の掴まり立ち出来る時期と最寄りに存在するネパール料理店のメニュー数、並びに2親等以内の家族が保持する義歯総数及び位置の相関性」に関するレポートを発表した。\n**回収日:** 2015/09/25\n**回収場所:** 長野県内第███小学校内。インタビューの結果全生徒は「自由研究は自主的に行った」と回答している。\n**現状:** カバーストーリー「全生徒合同研究」を配布した上で経過観察中。\n//赤ちゃんが早く掴まり立ちする程ネパール料理店のメニューは少なく、家族間では右の小臼歯に義歯が多くなる傾向にあるらしいです。//-█博士&#34;
